import React from 'react';
import { Paper } from '@material-ui/core';
import { Link } from 'react-router-dom';

export default (props) => {
  console.log(props);
  return (
    <Paper style={props.styles.paper}>
    Left Pane
    <br/>
    {
      props.types.map((type) =>
        <Link key={type.id} to="">{type.name}</Link>
      )
    }
    </Paper>
  );
}
